import { Switch } from "react-router-dom/cjs/react-router-dom.min";

const App = (props) => {
  const [pokemons] = useState(pokemonData);
  return (
    <Switch>
      <Route exact path="/">
        {" "}
        <div className="App">
          <h1 className="title"> Mi lista de Pokemon</h1>
          <PokeList pokemonData={pokemons} />
        </div>{" "}
      </Route>
    </Switch>
  );
};

export default App;
